        /* 전체 페이지 레이아웃을 Flexbox로 설정 */
        body {

            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: flex-start;
            padding: 20px;
        }

        .dropdown-container {
            position: absolute;
            top: 20px;
            left: 20px;
            z-index: 1000;
        }

        .dropdown {
            padding: 10px;
            font-size: 16px;
            cursor: pointer;
        }

        .visualization-container {
            display: flex;

            margin: 20px 0;
        }

        .visualization-section {
            flex: 1;
            padding: 20px;
            box-sizing: border-box;
            text-align: center;
            margin: 0 10px;
        }

        .movie-container {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            gap: 20px;
        }

        .movie-container img {
            width: 150px;
            height: 200px;
            object-fit: cover;
            border: 1px solid #ccc;
            border-radius: 8px;
        }

        /* 시각화 콘텐츠에 이미지 크기 맞추기 */
        .visualization-section img {
            width: 100%;
            height: auto;
        }
